import React, { Component } from 'react';

class Styles extends Component {
    render() {
        return (
            <div className='styles'>
                <div className='background'>
                    <p>Background</p>
                    <p>#283740</p>
                </div>
                <div className='primary'>
                    <p>Background</p>
                    <p>#94B6C2</p>
                </div>
                <div className='secondary'>
                    <p>Background</p>
                    <p>#B8B08C</p>
                </div>
                <div className='error'>
                    <p>Background</p>
                    <p>#BB9390</p>
                </div>
            </div>
        );
    }
}

export default Styles;
